import React from 'react';
import { Container, Box } from '@mui/material';
import Post from './Post';

// Sample data for posts
const samplePosts = [
  {
    id: 1,
    username: 'john_doe',
    userAvatar: 'https://i.pravatar.cc/150?img=1',
    image: 'https://source.unsplash.com/random/800x800?nature',
    caption: 'Beautiful day in nature! ðŸŒ¿ #nature #photography',
    likes: 124
  },
  {
    id: 2,
    username: 'jane_smith',
    userAvatar: 'https://i.pravatar.cc/150?img=2',
    image: 'https://source.unsplash.com/random/800x800?city',
    caption: 'City lights and urban vibes ðŸŒ† #cityscape #urban',
    likes: 89
  }
];

function Feed() {
  return (
    <Container maxWidth="sm">
      <Box sx={{ pt: 8, pb: 4 }}>
        {samplePosts.map(post => (
          <Post key={post.id} {...post} />
        ))}
      </Box>
    </Container>
  );
}

export default Feed;
